import logo from './logo.svg';
import './App.css';

function App() {
  const titre = "Ybenpro Blog";
  const contenu = "Contenu de la page";
  const likes = 150;
  return (
    <div className="App">
      <div className="contenu">
        <h2>{titre}</h2>
        <p>{contenu}</p>
        <p>{likes} personnes aiment ceci</p>
        <div>{"salut les prooos"}</div>
      </div>
    </div>
  );
}

export default App;
